using UnityEngine;
using Unity.Mathematics;
using Unity.Collections;
using System;
using UnityEngine.Rendering;
using Unity.Jobs;
using Unity.Burst;

public class LobbyLogoPush : MonoBehaviour
{
    [SerializeField] Mesh _mesh = null;
    [SerializeField] Material _material = null;
    float push = 0;
    float target = 0;

    PositionBuffer _buffer;

    public int count;

    void Start()
      => _buffer = new PositionBuffer(transform);

    void OnDestroy()
      => _buffer.Dispose();

    public void Play(float target)
      => this.target = target;

    void Update()
    {
        push = Mathf.Lerp(push, target, Time.deltaTime);
        _buffer.Update(push);

        var rparams = new RenderParams(_material)
          { receiveShadows = true,
            shadowCastingMode = ShadowCastingMode.On };

        var matrices = _buffer.Matrices;
        for (var offs = 0; offs < matrices.Length; offs += 1023)
        {
            var count = Mathf.Min(1023, matrices.Length - offs);
            Graphics.RenderMeshInstanced(rparams, _mesh, 0, matrices, count, offs);
        }

        count = matrices.Length;
    }
