        public PositionBuffer(Transform transform)
        {
            positions = new NativeArray<float3>(16500, Allocator.Persistent);
            Matrices = new NativeArray<Matrix4x4>(16500, Allocator.Persistent);
            logo = new NativeArray<int>(16500, Allocator.Persistent);
            var offs = 0;
            for (var i = 0; i < 50; i++)
            {
                var x = i * 0.05f + transform.position.x;
                for (var j = 0; j < 330; j++)
                {
                    var z = j * 0.05f + transform.position.z;
                    var p = math.float3(x, 0, z);
                    positions[offs] = p;
                    logo[i*330+j] = originalLogo[i*330+j];

                    var transformMatrix = math.mul(float4x4.Translate(p), float4x4.Scale(math.float3(0.05f, 0.25f, 0.05f)));

                    Matrices[offs] = transformMatrix;
                    offs++;
                }
            }
        }

        public void Dispose()
        {
            if (positions.IsCreated) positions.Dispose();
            if (Matrices.IsCreated) Matrices.Dispose();
            if (logo.IsCreated) logo.Dispose();
        }

        public void Update(float push)
        {
            var handle = new CalJob
            {
                Positions = positions,
                Matrices = Matrices,
                logo = logo,
                push = push
            }.Schedule(positions.Length, 64);

            handle.Complete();
        }

        [BurstCompile]
        struct CalJob : IJobParallelFor
        {
            public NativeArray<float3> Positions;
            public NativeArray<Matrix4x4> Matrices;
            public NativeArray<int> logo;
            public float push;
            public void Execute(int index)
            {
                if (logo[index] == 0)
                {
                    return;
                }
                var position = new float3(Positions[index].x, push, Positions[index].z );

                // 
                Matrices[index] = math.mul(float4x4.Translate(position), float4x4.Scale(math.float3(0.05f, 0.25f, 0.05f)));
            }
        }
    }

